import React from 'react'

function AddCard() {
  return (
    <div style={{padding:'10px',
                 margin:'10px',
                 width:'220px'}}>
      <img src="static/plus.svg" alt="" style={{width:'150px',color:'#d3d4d5',display:'block',marginLeft:'auto',marginRight:'auto'}}/>
    </div>
  )
}

export default AddCard
